// SPDX-License-Identifier: MIT

pragma solidity ^0.8.7;


contract BankTransaction{

    struct ClientTransaction{
        bytes20 payment_ID;
        address client_ID;
        address recipient_ID;
        uint amountOfPayment;
        uint timeOfPayment;
        string Remarks;
        bytes20 paymentHash;
    }

    bytes20[]  AllClientTXs;
    mapping(bytes20 => ClientTransaction) public clienttransactions;
    mapping (address=>bytes20[]) public TXsarray;


    function addNewPayment(
        address _recipient_ID,
        uint amountOfPayment,
        string calldata Remarks
    ) public returns (ClientTransaction memory clienttx){
        address _client_ID = msg.sender;
        uint timeStamp = block.timestamp;
        bytes20 _payment_ID = ripemd160(abi.encodePacked(_client_ID, _recipient_ID, amountOfPayment, timeStamp, Remarks));
        bytes20 _paymentHash = ripemd160(abi.encodePacked(_payment_ID, _client_ID, _recipient_ID, amountOfPayment,timeStamp,Remarks));
        clienttx = ClientTransaction(_payment_ID, _client_ID, _recipient_ID, amountOfPayment, timeStamp, Remarks, _paymentHash);

        TXsarray[_client_ID] ;

        clienttransactions[_payment_ID] = clienttx;
        AllClientTXs.push(_payment_ID);

    }

    function getPaymentByID(bytes20 _payment_ID) public view returns (ClientTransaction memory ct){
        ct = clienttransactions[_payment_ID];
        return clienttransactions[_payment_ID];
    }

    function getAllTransactionsOfAClient(address  _client_ID) external view  returns (bytes20[] memory Array){
        Array = AllClientTXs;
        return TXsarray[_client_ID];
    }

    /*There must be a BankTransaction structure in the contract, which
consists of the following fields: payment identifier (combination of letters and
digits), client identifier (combination of letters and digits), recipient identifier,
amount of the payment, time of the payment, note to the payment, the hashvalue of the payment obtained by concatenating the identifiers, the amount
and the time of the payment and hashing the resulting string using any
algorithm available in Solidity.
The contract must contain the following functions: adding a new
payment, getting information about the payment by its identifier, getting all
payments of a particular customer.*/
}

